import "../Styles/contact.css";

const Conctact = () => {
    return (
        <div className='container'>
            <div className='contact'>
                <h2>Contact me</h2>
                <div className='contact-me-flex-container'>
                </div>
            </div>
        </div>
    )
}

export default Conctact;
